import React from "react";

const Card = props => (
  <div style={cardStyle} onClick={() => props.roomSelected(props.id)}>
    <div style={imgContainerStyle}>
      <img style={imgStyle} alt={props.name} src={props.image} />
    </div>
  </div>
);

const cardStyle = {
  height: "350px",
  width: "350px",
  float: "left"
}

const imgContainerStyle = {
  height: "100%",
  overflow: "hidden",
  textAlign: "center",
  backgroundSize: "100%"
}

const imgStyle  = {
  display: "block",
    margin: "auto",
    paddingTop: "30px",
  width: "75%"
}

export default Card;
